import './possibility.css';

const Possibility = () => {
    return (
        <div className="project__possibility section__padding" id="possibility">
            <div className="project__possibility-image">
                <img src={possibilityImage} alt="possibility" />
            </div>
        </div>
    )
}

export default Possibility
